<template>
	<view class="nav">
		<!-- 系统状态栏 -->
		<view :style="'height:'+statusHeight+'rpx;'+containerStyle"></view>
		<!-- Navbar内容区 -->
		<view v-if="isHome" class="homeNav" 
		:style="'height:'+containerHeight
		+'rpx;line-height:'+containerHeight
		+'rpx;padding-left:20rpx;'">
			<text class="city">中部地区</text>
			<view style="flex: 1;">
				<navigator url="../../pages/search/index"
				:style = "'height:' + menuButton.height*2 
				+'rpx;line-height:'+ menuButton.height*2 
				+'rpx;margin-top:'+ (menuButton.top*2 - statusHeight)
				+'rpx;margin-left:32rpx;margin-right:' + (menuButton.width*2 + 24)
				+'rpx;background: #f4f4f4;border-radius:200rpx;text-align:center'"
				>
					<text class="search-text">找医院</text>
				</navigator>
			</view>
		</view>
		<view v-else :style="'height:'+containerHeight+'rpx;'+containerStyle" class="container">
			<view class="back-icon" @click="backOrHome">
				<image v-if="pagesCount > 1" src="/static/image/return.png"></image>
				<image v-else src="../../static/image/home.png"></image>
			</view>
			<view class="nav-title" v-if="titleText">
				<view :style="'height:'+containerHeight+'rpx;line-height:'+containerHeight+'rpx'">
					{{titleText}}
				</view>
			</view>
		</view>
	</view>
</template>

<script setup>
	import {ref, reactive, onBeforeMount, defineProps} from 'vue'
	// js中通过defineProps返回值获取props
	const props = defineProps({
		background: {
			type: String,
			default: 'rgba(255,255,255,1)'
		},
		color: {
			type: String,
			default: 'rgba(0,0,0,1)'
		},
		fontSize: {
			type: String,
			default: 32
		},
		iconWidth: {
			type: String,
			default: 116
		},
		iconHeight: {
			type: String,
			default: 38
		},
		titleText:{
			type:String,
			default:''
		}
	})
	
	// vue生命周期函数，页面渲染之前
	onBeforeMount(() => {
		setStatusHeight()
		setStyle()
		setIsHome()
	})
	
	//状态栏高度
	const statusHeight = ref(0)
	//内容高度
	const containerHeight = ref(0)
	//计算高度
	const setStatusHeight = () => {
		//uniapp的api获取系统信息
		const {system, statusBarHeight} = uni.getSystemInfoSync()
		statusHeight.value = statusBarHeight * 2
		const isIOS = system.indexOf('iOS') > -1
		if (isIOS) {
			//刘海占有一部分
			containerHeight.value = 88
		} else {
			containerHeight.value = 96
		}
	}
	

	//内容样式
	const containerStyle = ref('')
	//字体样式
	const fontStyle = ref('')
	//icon样式
	const iconStyle = ref('')
	const setStyle = () => {
		containerStyle.value = ['background:' + props.background].join(';')
		fontStyle.value = ['color:' + props.color, 'font-size:' + props.fontSize + 'rpx'].join(';')
		iconStyle.value = ['width:' + props.iconWidth + 'rpx', 'height:' + props.iconHeight + 'rpx'].join(';')
	}
	
	//uniapp的api获取页面栈的实例
	const pagesCount = ref(getCurrentPages().length)
	const backOrHome = ()=>{ 
		//当前页面栈=1是tabbar页面切换，>1是页面跳转
		if(pagesCount.value > 1){
			//页面内的普通跳转进行返回
			uni.navigateBack()
		}else{
			//tabbar页面切换回到首页
			uni.switchTab({
				url:'/pages/index/index'
			})
		}
	}
	
	const isHome = ref(false)
	const setIsHome = ()=>{
		const pages = getCurrentPages();
		const currentPage = pages[pages.length - 1];
		const url = currentPage.route;
		if (url === 'pages/index/index') { // 根据实际首页路径修改这里
		    isHome.value = true
		} else {
		    isHome.value = false
		}
		console.log(isHome.value)
	}
	
	//获取胶囊位置
	const menuButton = reactive(uni.getMenuButtonBoundingClientRect())
</script>

<style>
	/*固定定位，z-index: 2避免被遮挡*/
	.nav {
		position: fixed;
		width: 100%;
		top: 0;
		left: 0;
		z-index: 2;
	}
	
	/*设置icon位置和大小*/
	.back-icon {
		display: flex;
		align-items: center;
		width: 64rpx;
		height: 100%;
		margin-left: 20rpx;
	}
	.back-icon image {
		width: 64rpx;
		height: 64rpx;
	}
	
	/*设置字体位置*/
	.container {
		position: relative;
	}
	.nav-title {
		position: absolute;
		top: 0;
		left: 50%;
		transform: translate(-50%);
	}
	
	/*home页面图标 图片转base64：https://www.jyshare.com/front-end/59/ */
	.city {
		display: inline-block;
		position: relative;
		font-size: 30rpx;
		font-weight: bold;
		padding-left:55rpx;
		background:url(data:image/png;base64,)
		no-repeat left center;
		background-size: 40rpx;
	}
	.city:after {
		content:' ';
		display: inline-block;
		height: 6px;
		width: 6px;
		border-width:1px 1px 0 0;
		border-color:#353535;
		border-style: solid;
		-webkit-transform:matrix(0.71,0.71, -0.71,0.71,0,0);
		transform:matrix(0.71,0.71,-0.71,0.71,0,0);
		position: relative;
		top:-2px;
		position: absolute;
		top:50%;
		margin-top:-4px;
		right: -10px;
	}
	
	/*父级flex布局，子元素flex:1撑满*/
	.homeNav {
		display: flex;
	}
	.search-text {
		display: inline-block;
		padding-left: 30rpx;
		color: #bbbbbb;
		font-size: 26rpx;
		background: url(data:image/png;base64,)
		 no-repeat left center;
		background-size: 23rpx;
	}
</style>